// Optional helpers
export function findHarga({ brand, name, warna, prefer = "grosir" }) {
  const b = (brand || "").toString().toLowerCase();
  const n = (name || "").toString().toLowerCase();
  const w = (warna || "").toString().toLowerCase();
  const row = HARGA_PENJUALAN.find(
    (r) =>
      r.name.toLowerCase() === n &&
      (!b || r.brand.toLowerCase() === b) &&
      (!w || r.warna.toLowerCase() === w)
  );
  if (!row) return null;
  const price =
    prefer === "srp" ? row.srp || row.grosir : row.grosir || row.srp;
  return {
    ...row,
    harga: price,
    hargaType: prefer === "srp" ? "SRP" : "GROSIR",
  };
}

// Group by brand -> products (names) -> warna
export function getBrandIndex() {
  const map = new Map();
  for (const r of HARGA_PENJUALAN) {
    const b = r.brand || "";
    if (!map.has(b)) map.set(b, new Map());
    const m = map.get(b);
    if (!m.has(r.name)) m.set(r.name, new Set());
    m.get(r.name).add(r.warna || "");
  }
  // Convert to plain objects
  const out = [];
  for (const [brand, prodMap] of map.entries()) {
    const products = [];
    for (const [name, warnaSet] of prodMap.entries()) {
      products.push({ name, warna: Array.from(warnaSet).sort() });
    }
    products.sort((a, b) => a.name.localeCompare(b.name));
    out.push({ brand, products });
  }
  out.sort((a, b) => a.brand.localeCompare(b.brand));
  return out;
}

export default HARGA_PENJUALAN;
